function GetDetails(n,t){var i=GetSearchParam(n,t);HttpPost(`/PropertyInventoryReport/GetDetails`,"html",i,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(n,t){return{name:"test",pageSize:t,pageNumber:n}}function onPaging(n){GetDetails(parseInt(n),parseInt(currentPageSize));currentPageNumber=n}function onChangePageSize(n){GetDetails(parseInt(currentPageNumber),parseInt(n));currentPageSize=n}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){GetDetails(currentPageNumber,currentPageSize)});